// SPDX-License-Identifier: MIT
pragma solidity ^0.5.0;


/**
 @dev Required interface of an ERC721 compliant contract.
 */
interface IERC721 {
    /**
     @dev Emitted when `tokenId` token is transfered from `from` to `to`.
     */
    event Transfer(address indexed from, address indexed to, uint256 indexed tokenId);

    /**
     @dev Emitted when `owner` enables `approved` to manage the `tokenId` token.
     */
    event Approval(address indexed owner, address indexed approved, uint256 indexed tokenId);

    /**
     @dev Emitted when `owner` enables or disables (`approved`) `operator` to manage all of its assets.
     */
    event ApprovalForAll(address indexed owner, address indexed operator, bool approved);

    /**
     @dev Returns the number of tokens in ``owner``'s account.
     */
    function balanceOf(address owner) external view returns (uint256 balance);

    /*
     @dev Returns the total number of tokens in circulation.
     */
    function totalSupply() external view returns (uint256 total);

    /*
     @dev Returns the name of the token.
     */
    function name() external view returns (string memory tokenName);

    /*
     @dev Returns the symbol of the token.
     */
    function symbol() external view returns (string memory tokenSymbol);

    /**
    @dev Returns the owner of the `tokenId` token.
     
    Requirements:
    - `tokenId` must exist.
    */
    function ownerOf(uint256 tokenId) external view returns (address owner);


    /** 
    @dev Transfers `tokenId` token from `msg.sender` to `to`.
     
    Requirements:
    - `to` cannot be the zero address.
    - `to` can not be the contract address.
    - `tokenId` token must be owned by `msg.sender`.
     
    Emits a {Transfer} event.
    */
    function transfer(address to, uint256 tokenId) external;

    /** 
    @notice Change or reaffirm the approved address for an NFT
    @dev The zero address indicates there is no approved address.
      Throws unless `msg.sender` is the current NFT owner, or an authorized
      operator of the current owner.
    @param _approved The new approved NFT controller
    @param tokenId The NFT to approve
    */
    function approve(address _approved, uint256 tokenId) external;

    /** 
    @notice Enable or disable approval for a third party ("operator") to manage
      all of `msg.sender`'s assets
    @dev Emits the ApprovalForAll event. The contract MUST allow
      multiple operators per owner.
    @param _operator Address to add to the set of authorized operators
    @param _approved True if the operator is approved, false to revoke approval
    */
    function setApprovalForAll(address _operator, bool _approved) external;

    /**
    @notice Get the approved address for a single NFT
    @dev Throws if `tokenId` is not a valid NFT.
    @param tokenId The NFT to find the approved address for
    @return The approved address for this NFT, or the zero address if there is none
    */
    function getApproved(uint256 tokenId) external view returns (address);

    /** 
    @notice Query if an address is an authorized operator for another address
    @param _owner The address that owns the NFTs
    @param _operator The address that acts on behalf of the owner
    @return True if `_operator` is an approved operator for `_owner`, false otherwise
    */
    function isApprovedForAll(address _owner, address _operator) external view returns (bool);

    /**
    @notice Transfers the ownership of an NFT from one address to another address
    @dev Throws unless `msg.sender` is the current owner, an authorized
      operator, or the approved address for this NFT. Throws if `_from` is
      not the current owner. Throws if `to` is the zero address. Throws if
      `tokenId` is not a valid NFT. When transfer is complete, this function
      checks if `to` is a smart contract (code size > 0). If so, it calls
      `onERC721Received` on `to` and throws if the return value is not
      `bytes4(keccak256("onERC721Received(address,address,uint256,bytes)"))`.
    @param _from The current owner of the NFT
    @param to The new owner
    @param tokenId The NFT to transfer
    @param data Additional data with no specified format, sent in call to `to`
    */
    function safeTransferFrom(address _from, address to, uint256 tokenId, bytes calldata data) external;

    /**
    @notice Transfers the ownership of an NFT from one address to another address
    @dev This works identically to the other function with an extra data parameter,
      except this function just sets data to "".
    @param _from The current owner of the NFT
    @param to The new owner
    @param tokenId The NFT to transfer
    */
    function safeTransferFrom(address _from, address to, uint256 tokenId) external;

    /** 
    @notice Transfer ownership of an NFT -- THE CALLER IS RESPONSIBLE
      TO CONFIRM THAT `to` IS CAPABLE OF RECEIVING NFTS OR ELSE
      THEY MAY BE PERMANENTLY LOST
    @dev Throws unless `msg.sender` is the current owner, an authorized
      operator, or the approved address for this NFT. Throws if `_from` is
      not the current owner. Throws if `to` is the zero address. Throws if
      `tokenId` is not a valid NFT.
    @param _from The current owner of the NFT
    @param to The new owner
    @param tokenId The NFT to transfer
    */
    function transferFrom(address _from, address to, uint256 tokenId) external;
}

